import "../../../";
import "./Wrapper.css";
const Wrapper = (props) => {
    return(
        <article className="wrapper">
            <img className="wrapper__image" src="../../"></img>
            <header className="wrapper__header">
                <h1 className="wrapper__title">Title</h1>
            </header>
            <section className="wrapper__section">
                <p className="wrappersection__paragraf">Ben jij opzoek naar Speciale Custom kleding. Koopt het nu Bijm ons!!</p>
                <button className="wrapper__button">Koop Nu</button>
            </section>
        </article>
    );
}

export default Wrapper;
